import React from 'react'
import Logo from '../assets/img/logo.png';
import '../styles/header.css';

function Header() {
    return (
        <div className="header-content">
            <div className="header">
                <div className="logo">
                    <img src={Logo} alt="Andrea Recuyo Avatar Logo"></img>
                </div>
                <nav className="nav">
                    <ul>
                        <li data-menuanchor="hello" className="active"><a href="#hello">Hello</a></li>
                        <li data-menuanchor="about"><a href="#about">About</a></li>
                        <li data-menuanchor="skills"><a href="#skills">Skills</a></li>
                        <li data-menuanchor="works"><a href="#works">Works</a></li>
                        <li data-menuanchor="contact"><a href="#contact">Contact</a></li>
                    </ul>
                </nav>
            </div>
        </div>
    );
}

export default Header;
